	/**
	 * _socialPhonegapLogin performs social authentication using a phonegap plugin
	 *
	 * @param {String}   connection   Name of the connection.
	 * @param {function} callback     To be called after login happened (whether
	 *                                success or failure).
	 * @private
	 */
	
